import React from 'react';
import { Link } from 'react-router-dom';
import './ProductList.css';
import ProductItem from "../Item/ProductItem";

const ProductList = ({ products }) => {
    return (
        <div className="product-list">
            {products.map(product => (
                <div key={product.productId} className="product-item">
                    <Link to={`/products/${product.productId}`} className="product-link">
                        <img src={product.imageUrls[0]} alt={product.name} className="product-image" />
                        <ProductItem className="product-name" productName={product.name} price={product.price} />
                    </Link>
                </div>
            ))}
        </div>
    );
};

export default ProductList;
